/**
 * Area where users can edit their links
 *
 * @copyright 2021 Beacons - All rights reserved
 */

 import './styles/links_editor.scss';

 function LinksEditor() {
  const linksData = [
    {
      id: 1,
      url: '#',
      title: 'Link 1',
      clicks: 4
    },
    {
      id: 2,
      url: '#',
      title: 'Link 2',
      clicks: 32
    }
  ];

   return (
     <div className="links-editor">
       <div className="current-links-editor">
         <ul>
          {linksData.map((linkData, index) => (
            <li>
              <a href={linkData.url}>{linkData.title}</a>
              <span>Clicks: {linkData.clicks}</span>
            </li>
            ))}
         </ul>
       </div>
       <div className="links-editor__add-link"></div>
     </div>
   );
 }

 export default LinksEditor;
